  render() {
    return (
      <Box
        sx={{
          position: "relative",
          maxWidth: "200em",
          minHeight: "100vh",
          background:
            "linear-gradient(180deg, rgba(0, 0, 0, 0.1) 0%, rgba(0, 0, 0, 0) 100%), linear-gradient(0deg, rgba(0, 0, 0, 0.4), rgba(0, 0, 0, 0.4)), url(https://pixabay.com/get/g52b000a45dc7c426c170c82896ef6b28e41d1e76c2798afed489ff0077c9582e3016c68b4427687b0f22173b55eaf2cff94a18361b5f62e5253992daac6c7c1c_1920.jpg)",
        }}
        alt="forest"
      >
        <Navigation />
        <Typography
          sx={{
            fontFamily: "Libre Baskerville",
            fontStyle: "normal",
            fontWeight: 400,
            fontSize: "98px",
            textAlign: "center",
            mt: 5,
            color: "#fff",
          }}
        >
          Conquer the forest
        </Typography>
        <Typography
          // component="div"
          sx={{
            // fontStyle: "normal",
            // fontWeight: 500,
            // fontSize: "16px",
            // textAlign: "center",
            // mt: 5,
            // color: "#fff",
            // position: absolute;
            width: "677px",
            height: "66px",
            left: "400px",
            top: "343px",

            fontStyle: "normal",
            fontWeight: 500,
            fontSize: "16px",
            lineHeight: "140%",
            /* or 22px */

            textAlign: "center",
            letterSpacing: "-0.02em",

            color: "#FFFFFF",
          }}
        >
          Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do
          eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad
          minim veniam, quis nostrud exercitation ullamco laboris nisi ut
          aliquip ex ea commodo consequat. Duis aute irure dolor in
          reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla
          pariatur. Excepteur sint occaecat cupidatat non proident, sunt in
          culpa qui officia deserunt mollit anim id est laborum
        </Typography>
        <Cards />
      </Box>
    );
  }
}

export default Home;
